import React from 'react'
import Script from "react-inline-script"
 
export default class MarineTrafficMap extends React.Component {
  constructor(props) {
    super(props)
  }
 
  render() {
    return (
      <div id="some-content">
        <Script>
        	{`
        		const test = true
        		if (test)
        			alert("howdy!")
        	`}
        </Script>
      </div>)
    }
}
